MathJax.Localization.addTranslation("ast","FontWarnings",{version:"2.7.9",isLoaded:!0,strings:{webFont:"MathJax ta usando fontes basaes en web p'amosar les matem\xE1tiques d'esta p\xE1xina. Lleva un tiempu descargales, de manera que la p\xE1xina apaecer\xE1 m\xE1s r\xE1pidamente si instala direutamente les fontes matem\xE1tiques na carpeta de fontes del so sistema.",imageFonts:"MathJaz ta usando les sos fontes d'imaxe en cuenta de fontes llocales o basaes en web. Esto fai que la composici\xF3n seya m\xE1s lenta de lo normal, y les matem\xE1tiques podr\xEDen nun imprimise a la resoluci\xF3n completa de la impresora.",noFonts:"MathJax nun pue alcontrar una tipograf\xEDa que pueda usar p'amosar les espresiones matem\xE1tiques, y nun hai disponibles fontes d'imaxe, de mou que va volver a car\xE1uteres Unicode xen\xE9ricos esperando que'l so restolador pueda amosalos. Algunos car\xE1uteres podr\xEDen nun vese correutamente o, seique, podrien nun vese n'absoluto.",webFonts:"La mayor\xEDa de restoladores modernos permiten que les fontes se descarguen de la web. Si anueva a una versi\xF3n m\xE1s moderna del restolador (o si cambia de restolador) podr\xEDa ameyorar la calid\xE1 de les espresiones matem\xE1tiques d'esta p\xE1xina.",fonts:"MathJax pue usar tanto la [tipograf\xEDa STIX](%1) como la [tipograf\xEDa TeX MathJax](%2). Descargue y instale una d'estes tipograf\xEDes p'ameyorar la so esperiencia con MathJax.",STIXPage:"Esta p\xE0xina ta dise\xF1ada pa usar la [tipograf\xEDa STIX](%1). Descargue ya instale esta tipograf\xEDa p'ameyorar la so esperiencia con MathJax.",TeXPage:"Esta p\xE0xina ta dise\xF1ada pa usar la [tipograf\xEDa TeX MathJax](%1). Descargue ya instale esta tipograf\xEDa p'ameyorar la so esperiencia con MathJax."}}),MathJax.Ajax.loadComplete("[MathJax]/localization/ast/FontWarnings.js");
